        for (var i = this.day; i < 7; i++) {
            var info = this.weekday_text[i];
            var info_arr = info.split(": ");
            this.weekday_arr.push(info_arr[0]);
            this.hours_arr.push(info_arr[1]);
            // console.log(this.weekday_arr);
            // console.log(this.hours_arr);
        }
        for (var j = 0; j < this.day - 1; j++) {
            var temp = this.weekday_text[j];
            var temp_arr = temp.split(": ");
            this.weekday_arr.push(temp_arr[0]);
            this.hours_arr.push(temp_arr[1]);
        }
        // check open or close
        if (this.open_now) {
            var str = this.weekday_text[this.day - 1];
            var idx = str.indexOf(" ");
            var txt = str.substr(idx + 1);
            this.hours = 'Open now: ' + txt;
        }
        else {
            this.hours = 'Closed ';
        }
        // calculate rating percentage
        this.percent = (this.rating / 5) * 100 + '%';
